CREATE DEFINER=`root`@`localhost` PROCEDURE `poblar_agendamiento_dia_parcial`(IN fecha_base DATE)
BEGIN
    DECLARE hora VARCHAR(5) DEFAULT '08:00';
    DECLARE fecha_hora DATETIME;
    DECLARE esp INT;
    DECLARE especialidad_nombre VARCHAR(100);
    DECLARE cupo_max INT;
    DECLARE num_registros INT;
    DECLARE i INT;

    DECLARE paciente_id INT;
    DECLARE paciente_nombre VARCHAR(45);
    DECLARE paciente_apellido VARCHAR(45);
    DECLARE paciente_rut INT;
    DECLARE paciente_dv VARCHAR(1);
    DECLARE paciente_fonasa INT;
    DECLARE paciente_pervision VARCHAR(45);

    DECLARE profesional_id INT;
    DECLARE profesional_nombre VARCHAR(45);
    DECLARE profesional_apellido VARCHAR(45);
    DECLARE profesional_rut INT;
    DECLARE profesional_dv VARCHAR(1);

    hora_loop: WHILE hora <= '19:30' DO
        SET esp = 1;
        esp_loop: WHILE esp <= 7 DO

            -- 1) Determinar cupo máximo según especialidad
            IF esp IN (1,7) THEN
                SET cupo_max = 4;
            ELSEIF esp IN (2,3,4,5,6) THEN
                SET cupo_max = 10;
            ELSE
                ITERATE esp_loop;
            END IF;

            -- 2) Nombre de la especialidad
            SELECT especialidad
              INTO especialidad_nombre
              FROM especialidad
             WHERE idespecialidad = esp;

            -- 3) Número aleatorio de registros [1..cupo_max]
            SET num_registros = FLOOR(1 + RAND() * cupo_max);

            SET i = 0;
            registro_loop: WHILE i < num_registros DO

                -- 3.1) Paciente aleatorio
                SELECT idpaciente, nombre, apellido, rut, dv, fonasa, pervision
                  INTO paciente_id, paciente_nombre, paciente_apellido,
                       paciente_rut, paciente_dv, paciente_fonasa, paciente_pervision
                  FROM paciente
                 ORDER BY RAND()
                 LIMIT 1;

                -- 3.2) Profesional aleatorio de esa especialidad
                SELECT idprofesional, nombre, apellido, rut, dv
                  INTO profesional_id, profesional_nombre,
                       profesional_apellido, profesional_rut, profesional_dv
                  FROM profesional
                 WHERE idEspecialidad = esp
                 ORDER BY RAND()
                 LIMIT 1;

                -- 3.3) Fecha y hora completas
                SET fecha_hora = TIMESTAMP(fecha_base, hora);

                -- 3.4) Insertar
                INSERT INTO agendamiento (
                    cod_m, esp_m, fecha, hora,
                    vino, atendio, fonasa, rut, dv, idPaciente,
                    medico, especialidad, pervision
                )
                VALUES (
                    profesional_id, esp, fecha_hora, hora,
                    0, 0, paciente_fonasa, paciente_rut, paciente_dv, paciente_id,
                    CONCAT(profesional_nombre, ' ', profesional_apellido),
                    especialidad_nombre, paciente_pervision
                );

                SET i = i + 1;
            END WHILE registro_loop;

            SET esp = esp + 1;
        END WHILE esp_loop;

        -- Avanzar 30 minutos
        SET hora = DATE_FORMAT(
            ADDTIME(STR_TO_DATE(hora, '%H:%i'), '00:30:00'),
            '%H:%i'
        );
    END WHILE hora_loop;
END ;;
